wrapper-non-uups.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

interface IArbitrumProfileSender {
    function createProfile(
        uint32 _dstEid,
        string calldata _username,
        bytes calldata _options
    ) external payable;
}

contract ProfileCaller {
    IArbitrumProfileSender public immutable profileSender;

    constructor(address _profileSender) {
        profileSender = IArbitrumProfileSender(_profileSender);
    }

    function createProfile(
        uint32 _dstEid,
        string calldata _username,
        bytes calldata _options
    ) external payable {
        profileSender.createProfile{value: msg.value}(
            _dstEid,
            _username,
            _options
        );
    }
}

